import React from "react";
import { Grid } from "@material-ui/core";

const About = () => {
    return(
        <React.Fragment>
           <Grid container xm = {12} spacing = {4}>
               <Grid item lg = {6} md = {12} sm = {12} xm = {12} style = {{backgroundColor: 'black'}}><h1>About me</h1></Grid>
               <Grid item lg = {6} md = {12} sm = {12} xm = {12} style = {{backgroundColor: 'red'}}><h1>About Status</h1></Grid>
           </Grid>
        </React.Fragment>
    );
}

export default About;
